  ext x
  simp only [mem_union, mem_iInter]
  constructor
  { rintro (xs | h); intro i; exact Or.inr xs <|> exact Or.inl (h i) }
  { intro h; by_cases xs : x ∈ s; exact Or.inl xs; exact Or.inr (fun i => (h i).resolve_right xs) }

